import Card from './Card'
import Ribbon from './top-ribbon';
import './home-styling.css'
import { useQuery } from '@tanstack/react-query';
import axios from 'axios'
function usePosts() {
    return useQuery(["posts"],   async () => {
      const { data } = await axios.get(
        "https://obscure-refuge-62167.herokuapp.com/products"
      );
      return data;
    });
}
function Home(){
    const {data,status}=usePosts()
    if (status=='loading')
    console.log(data)
    let cards=[];
    data.forEach((element,id) => {cards.push(<div className='card' key={id}><Card/></div>)})
    return (
        <>
        <Ribbon/>
        <div className='cards-container'>
            {cards}
        </div>
        </>
    )
}
export default Home;
